"Iga kuduja vajab head koekirjakogu ja see siin sobib ühtviisi hästi nii algajale kui ka kogenud käsitöölisele. Raamatust leiate lihtsate parem- ja pahempidiste pindade kõrval ka tekstuurseid ja pitsmustreid. Lisaks iga koekirja kudumist põhjalikult selgitavatele juhenditele on antud ka skeemid.„250 koekirja“ on jagatud 11 alarühma: parem- ja pahempidiste silmustega koed; keerdude ja viklisilmustega koed; õhksilmused ja pits; nupud ja kobarad; voldid, kurrud ja seljandikud; aasad ja tekstuurid; 
