Kättemaks GERT LEDIG Romaan kirjeldab sündmusi nimetus Saksa linnas liitlasvägede tunniajalise õhurünnaku käigus II maailmasõja lõpu eel ja toob lugejale silme ette, mida tegelikult tähendas see, et „üksnes Royal Air Force heitis oma 400 000 lennul vaenlase territooriumile miljon tonni pomme; et mõnda vaid ükskord, paljusid korduvalt rünnatud 131 linnast tehti mõni peaaegu täiesti maatasa; et Saksamaal langes õhusõja ohvriks ligi 600 000 tsiviilisikut; et hävitati kolm ja pool miljonit eluaset; 
..........
usuguseid „hirmust kaasa tõmmatuid” on siiakanti liialt palju. Kiites Gert Ledigi romaani „Kättemaks” mõjusust ja naturalistlikku olukirjeldust ja öeldes veel, et kirjapandu lihtsalt ajab õudusest öökima, siis võib natuke nii tunduda küll. See on tõesti üks hirmus raamat sõjast ja koledast, mida üks põhjalik linna pommitamine võib kaasa tuua. Raamat ei arutle, kas sakslased olid ära teeninud, et nende 131 linna koos 600 000 tsiviilisikuga hävitati ja kas see oli selleks, et sõja lõppu kiirendada
